One night at Jazz Fest💕🤘🏾

JF for me is just as much about what happens after the fest grounds close… That’s when JF after-dark starts: an epic meeting of genius music minds & legends all through New Orleans into the wee hours… you never know what magic you will catch or what master you will stand shoulder to shoulder with. It’s Disneyland for musicians, as we roll into week two of JF I just want to express my immense gratitude, I’m so inspired to grow, I’m so inspired to express and to make music that transcends time and genre, by these musical moments & giants I’ve been blessed to share stages with… like wow. I’m taking it all in. 

